About us:

Animal Care is a business dedicated to providing wide range of Consumer and Animal products across various distribution channels including Masterpet, Aristopet and Lyppard.

Animal Care is a subsidiary of the EBOS Group. With almost 5,000 employees in 109 locations across Australia, New Zealand, and Southeast Asia, EBOS Group is the largest and most diversified Australasian marketer, wholesaler and distributor of healthcare, medical and pharmaceutical products. It is also a leading marketer and distributor of recognised animal care brands.

EBOS Group is publicly listed on the New Zealand and Australian stock exchanges.

The Opportunity:

Our Animal Care business is in search of a Business Intelligence (BI) Business Analyst to join their finance team.

In this role you will gather and analyse data to provide valuable insights and support data-driven decision-making processes. You will also collaborate with various teams, stakeholders, and business units to understand their analytical needs and deliver actionable reports, dashboards, and data visualizations, hence your strong communication, ability to build relationships and work cross functionally will be critical to your success.

This is an exciting role which will provide you with multiple touchpoints across the business, allow you to apply your analysis and BI skills and ultimately provide a lot of value add to the business.

What you will do:
• Collect and validate data from different sources, databases, and systems;
• Assist in the design and development of dashboards, reports, and visualisations using TM1 BI tools;
• Ensure data accuracy and consistency in all reports and dashboards;
• Work with teams to ensure data integration and ETL processes are functioning effectively;
• Identify and resolve data quality and integration issues;
• Conduct testing and support sessions with end-users on TM1 and applications;
• Provide ongoing support to users, addressing any queries or issues related to data analysis and reporting;
• Ad hoc Projects.

What we are looking for:
• Proficiency in BI Tools such as TM1, model development and dashboard reporting essential;
• Prior experience working within a Business Analyst, Systems Accountant or similar role;
• Excellent analytical and problem-solving capability;
• Strong business acumen and data driven decision-making skills;
• Initiative and drive to achieve outcomes.

Benefits

This is a unique opportunity to work in a company where you are valued, given the recognition you deserve and suitably rewarded for your hard work.

Other benefits include:
• Employee Share Plan;
• Company Paid Parental Leave;
• Employee Assistance Program for Mental Health Wellbeing;
• Staff Awards;
• Employee Referral Program;
• Health Insurance Discounts;
• And More.

EBOS Group are committed to developing and creating an inclusive workplace that embraces and celebrates diversity and inclusion. We recognise that a diverse workplace improves our ability to attract, retain, motivate and develop talent, create an engaged workforce, deliver quality services to our customers and to support the growth of EBOS Group.

EBOS Group are an equal opportunity employer and encourage applications from people of all ages, nationalities and cultures including Aboriginal and Torres Strait Islander peoples.

