The Forensic Technology Services Team

Clayton Utz is a leading Australian top tier law firm. Our Forensic & Technology Services (FTS) practice group is one of Australia's fastest growing forensic practices and is an integral and thriving part of the firm. Rapid success and growth enables us to engage individuals who are seeking an opportunity to further drive the FTS practice, and be a part of our market leading projects moving forward.

The role

We currently have an exciting opportunity for an experienced Data Analytics leader to join our Forensic and Technology Services (FTS) team located in Sydney or Canberra, on a full time basis.

Key Responsibilities

Join the FTS leadership team during an exciting phase of growth and innovation. The role will see you working with industry leading professionals and top end clients, on some of the biggest legal, fraud, anti-bribery, corruption, cyber risk, supply chain risk, and regulatory investigations in Australia.

You will be responsible for leading a team and helping to grow the Forensic Data Analytics function for our Public Sector clients, working closely with leader of the eDiscovery, Cyber, and Forensic Accounting streams.

Oversee multiple projects encompassing various responsibilities, including: collaborating with our Public Sector leaders to develop and deliver on a portfolio of legal data analytics projects for Public Sector clients; providing oversight of the engagement strategy/approach; overseeing client deliverables; preparing final deliverables; managing client's expectations; and assuming responsibility for engagement economics to achieve revenue goals.

Develop/maintain strong working relationships with key business decision makers.

Develop people. Successfully delegate to all levels of staff. Assume a leadership role in training, development, and instruction, and contribute to practice-wide recruiting efforts. Foster teamwork and innovative thinking.

Generate new business opportunities. Achieve growth by understanding CU national practice groups and actively assessing/presenting opportunities for CU to provide quality services. Develop long-term relationships and networks.

Skills & Experience

To be successful in this role, you will have:
• prior experience in a leadership role focussed on supporting Public Sector clients with legal, forensic, or regulatory issues;
• in-depth data analysis experience gained in a professional services or related firm;
• a passion for leading a team and supporting them to achieve results;
• possess strong client-facing capability and an interest in business development;
• in-depth knowledge of Data Analytic environments such as SQL and Dashboard Visualisation (Tableau / PowerBI);
• demonstrated ability to manage large engagements and prioritise projects;
• strong financial, analytical, technical, and interpersonal skills;
• excellent written and verbal communication skills;

Benefits
• Clayton Utz is one of the leading firms in an emerging global transformation of the industry, join us to help shape the future of law;
• Early adopter of AI technologies shaping AI-driven legal solutions for clients;
• Be part of a rapidly growing and energetic team that offers genuine career opportunities;
• Relentless focus on professional ethics and developing a sustainable career trajectory;
• Flexible working arrangements;
• Access to the right industry standard tool to conduct your work the way you like to work;
• The opportunity to apply your skills in a legal environment and learn new perspectives from our legal teams;
• Work with a diverse team skilled in various disciplines.
• Generous bonus structure and other perks!

How to Apply?

We prefer to work directly with candidates, if you are interested in this role, please click the ‘Apply’ button.. Clayton Utz is an inclusive employer that supports flexible work arrangements, please feel free to discuss your flexibility needs with the recruiter for this role.

Accessibility and Inclusion

We are committed to making reasonable adjustments to provide a positive, barrier-free recruitment process. Do you require any support or reasonable adjustments to complete your application? If so, please contact recruitmentsupport@claytonutz.com.

For more information on Clayton Utz, please visit www.claytonutz.com or follow us on LinkedIn here.

Agency submissions

Clayton Utz does not accept agency submissions unless the agency is specifically contacted by a member of the Clayton Utz Recruitment Team. Please do not forward candidate profiles or resumes to Clayton Utz partners, hiring managers or other employees - this will not constitute as an introduction to the firm and Clayton Utz will not be liable for a fee.

Role : Data Engineer

Skill -Data Analytics, Databricks, DWH and SQL

Location : Sydney

Job Type- Permanent

Responsibilities:
• Understand the SDLC model and what their specific activities are in designing and then delivering a solid, robust application, ensuring that it is communicated to internal Tech and Ops teams, business units and external partners and contractors, as required;
• Contribute to; technical design & analysis, software programming, software integration, package evaluation, package configuration and support, ensuring the end-to-end integrity and functionality of the software is within scope of the business solution;
• Design and develop code and/or application configuration and that is clean, understandable, maintainable, solid and aligns to coding and source code development standards;
• Design, develop and implement test plans to accurately test the application code, functions, modules, configuration and programs;
• Develop and maintain detailed and accurate documentation
