Interested candidates can send their updated CV to anoop.redhu@carecone.com.au or reach me @ M: +61 2 8880 6489

What you’ll do:
• Participate in the development and implementation of a clearing risk data management solution;
• Build and deploy highly effective data pipelines and data platforms that enable a smooth and uninterrupted flow of data;
• Ongoing development and support of the data infrastructure (Cloud Platform, Data Lake & DataMarts and Dashboards);
• Review and analyse the current Clearing Risk reporting process and lead the migration of static risk reports to dynamic risk dashboards;
• Participate in the data governance process for the wider Clearing Risk Quantification team, including maintaining registers of data owners, approved data sources and tracking of KRIs of critical data elements;
• Implement ETL processes/pipelines, using CI/CD processes;
• Enhance the data engineering practice through standardised methods and continuous improvements in core engineering competencies.

What you’ve done:
• Tertiary qualification in a technical discipline (eg Mathematics, Computer/Data Science etc) and industry experience as a data engineer on both existing and emerging data trends analysing real world data;
• 3+ years experience with data modelling, data analysis, visualization tools (e.g. SQL Advanced, Python, Data Vault, Star Schema/Dimensional Modelling, TIBCO Spotfire, Power BI, Tableau, SQL, R or);
• Exposure to Google Cloud, AI Vertex Workbench
• Relevant risk management or investment exposure.
• Knowledge of Australia Financial Markets

What you need to enjoy and be good at for this role:
• Highly motivated, able to work autonomously and collaboratively;
• Excellent critical thinking, problem solving and quantitative skills;
• Good communication skills;
• Ability to drive change and initiate solutions.
• Knowledge of Derivatives is an asset
• Understanding of Clearing Risk
